package io.wkna.sdp.structures;

import com.sun.org.apache.xerces.internal.impl.dv.util.HexBin;

import java.io.IOException;
import java.nio.ByteBuffer;
import java.nio.ByteOrder;
import java.nio.channels.SeekableByteChannel;

import static io.wkna.sdp.DemoUtils.*;

public class NetData {
    // The data type
    private int type;
    private byte typeByte;
    // The data provided
    private byte[] data;

    public NetData(SeekableByteChannel sbc, int dataSize) throws IOException {
        ByteBuffer buffer = ByteBuffer.allocate(dataSize);
        sbc.read(buffer);
        typeByte = buffer.get(0);
        type = typeByte & 0xFC;
        //.out.println("\t\t\ttype: " + type);
        data = new byte[dataSize - 1];
        buffer.position(1);
        buffer.get(data, 0, dataSize - 1);
        //System.out.println("\t\t\tdata: " + new String(data));
        //System.out.println("\t\t\thex: " + HexBin.encode(data));
        /*ByteBuffer floatBuf = ByteBuffer.allocate(4);
        floatBuf.order(ByteOrder.LITTLE_ENDIAN);
        for(int i = 0; i < data.length; i++){
            if(i + 4 < data.length){
                floatBuf.position(0);
                floatBuf.put(data, i, 4);
                floatBuf.position(0);
                System.out.println("Offset " + i + " time: " + floatBuf.getInt());
            }
        }*/
    }

    public byte[] getData() {
        return data;
    }

    public int getDataSizeFlattened() {
        return data.length + 1;
    }

    public int write(ByteBuffer dst, int remaining, long offset) {
        int totalWrites = 0;

        if(offset < 1) {
            totalWrites += writeByte(typeByte, dst, remaining - totalWrites);
            if(totalWrites == remaining) {
                return totalWrites;
            }
        }
        if(offset < 1+data.length) {
            totalWrites += writeRawData(data, dst, remaining - totalWrites, getOffset(offset, 1));
            return totalWrites;
        }

        throw new IllegalArgumentException("NetData offset must be less than the size of the data.");
    }

    public static void main(String[] args){
        String hex = "";
        byte[] data = HexBin.decode(hex);
        ByteBuffer floatBuf = ByteBuffer.allocate(4);
        floatBuf.order(ByteOrder.BIG_ENDIAN);
        for(int i = 0; i < data.length; i++){
            if(i + 4 < data.length){
                floatBuf.position(0);
                floatBuf.put(data, i, 4);
                floatBuf.position(0);
                float floatGuess = floatBuf.getFloat();
                floatBuf.position(0);
                int intGuess = floatBuf.getInt();
                if(Math.abs(floatGuess) < 2 && floatGuess > 1) {
                    System.out.println("Offset " + i + " float time: " + floatGuess);
                }
                if(Math.abs(intGuess) < 120 && Math.abs(intGuess) > 60) {
                    System.out.println("Offset " + i + " int time: " + intGuess);
                }
            }
        }
    }
}
